window.bookSummaryJSON = "<p>Hockey with benefits. That was what Mara proposed, and I was down. She said no feelings, and she meant it. Just benefits. No strings attached. Nothing else. Not even friendship.</p> <p>College was her escape, including us.</p> <p>I didn't have time for a girlfriend. I had classes, the team, my family, and the game. It was all working too....</p> <p>Until somewhere down the line, things got messy.</p> <p>Until somehow we were dealing with threats, secrets, rivals, and so much more.</p> <p>Until I began to want her in ways that weren't part of the deal.</p> <p>Our agreement didn't just get checked into the wall, it got obliterated.</p>"; 
